import React from 'react';

function Card () {
return (
  <li className="element">
      <img className="element__image" alt="фотография"/>
      <button className="button element__delete-button"></button>
      <div className="element__name">
        <h2 className="element__title"></h2>
      <div className="element__like-container">
        <button className="button element__like-button"></button>
        <h3 className="element__like-counter">0</h3>
      </div>
      </div>
    </li>
)
}

export default Card;
